import { SaveIcon } from "../../assets/icons";
import LoginGoogle from "../../components/common/LoginGoogle";
import ProfileContent from "../../components/common/ProfileContent";
import { SignInButton } from "../../components/common/SignInButton";
import { SignOutButton } from "../../components/common/SignOutButton";
import styles from "./login.module.scss";

const Login = () => {
  return (
    <div className={styles["login-page"]}>
      <div className={styles["login-card"]}>
        <h1 className={styles["welcome-text"]}>Welcome to Intelli GUI</h1>
        <div className={styles["login-buttons-group"]}>
          <SaveIcon />
          <LoginGoogle />
          <SignInButton />
        </div>
      </div>
    </div>
  );
};
export default Login;
